class Pricing extends React.Component{

    render(){
        return (
            <Container>
                <Card>
                    <h3>$721/Month</h3>
                    <Row>
                        <Col md={6}>

                        </Col>
                    </Row>
                </Card>
            </Container>
        );
    }
}

export default Pricing;
